    options: ["검정치마", "몽니", "디어클라우드", "짙은"],
    answer: "검정치마",
  },
  {
    q: "다음 앨범 아트는 몇집인가?",
    image: "./images/6.jpeg",
    options: ["1집", "2집", "3집", "4집"],
