    options: ["2014", "2015", "2016", "2017"],
    answer: "2017",
  },
  {
    q: "다음 장소와 관련 없는 페스티벌은?",
    image: "./images/8.jpeg",
    options: ["뷰티풀 민트 라이프", "그린 플러그드인", "그랜드 민트 페스티벌", "서울 재즈 페스티벌"],
