  },
  {
    q: "다음 심벌과 관련 있는 페스티벌은?",
    image: "./images/9.jpeg",
    options: ["지산 록밸리", "펜타포트", "렛츠락 페스티벌", "UMF"],
    answer: "펜타포트",
