  {
    q: "다음 악보의 노래 제목은?",
    image: "./images/14.png",
    options: ["나는 그 사람이 아프다", "봄날, 벚꽃 그리고 너", "꽃처럼 한철만 사랑해줄건가요", "조금이라도 위로가 된다면 곁에 있을게"],
    answer: "봄날, 벚꽃 그리고 너",
  },
  {
    q: "다음 곡의 아티스트는?",
    image: "./images/15.png",
    options: ["솔루션스", "브로큰 발렌타인", "라이프 앤 타임", "쏜애들"],
    answer: "브로큰 발렌타인",
  },
  {
    q: "다음 곡이 수록되어있는 앨범 이름은?",
