    answer: "신의 놀이",
  },
  {
    q: "다음 사진 속 인물이 콜라보, 피처링 한 적 없는 아티스트는?",
    image: "./images/17.jpeg",
    options: ["김간지", "라이너스의 담요", "주윤하", "윤석철"],
    answer: "주윤하",
  },
  {
    q: "다음 첫 정규앨범의 아티스트는?",
    image: "./images/18.jpeg",
    options: ["푸르내", "얄개들", "칵스", "파라솔"],
    answer: "얄개들",
  },
  {
    q: "다음 앨범의 발매일은?",
    image: "./images/19.jpeg",
    options: ["2003.01.24", "2007.10.21", "2004.03.29", "2001.09.12"],
    answer: "2003.01.24",
  },
  {
    q: "다음 중 현재 음반사(사진)에 없는 사람은?",
    image: "./images/20.png",
    options: ["권나무", "이영훈", "구원찬", "소수빈"],
    answer: "권나무",
  },
